START_PHOTO = ''
NAMES = ""


def factorial(N):
    if N < 2:
        return 1
    return reduce(lambda x, y: x * y, [i for i in range(1, N + 1)])


def get_table_elem(x):
    if isinstance(x, int):
        return str(x)
    if str(x).isdigit() or '.' in str(x) or '-' in str(x):
        return ('%.4f' % x).replace('.', ',')
    return str(x)


def p0(N, psi, C):
    pk = [[0] for i in range(N + 1)]
    for k in range(C + 1):
        pk[k] = factorial(N) * psi ** k / (factorial(k) * factorial(N - k))
    for k in range(C + 1, N + 1):
        pk[k] = factorial(N) * psi ** k / (C ** (k - C) * factorial(C) * factorial(N - k))
    pk = [elem / sum(pk) for elem in pk]
    return pk


def q(pk, C, N):
    q = 0
    for k in range(C + 1, N + 1):
        q += (k - C) * pk[k]
    return q


def L(pk, N):
    l = 0
    for k in range(1, N + 1):
        l += k * pk[k]
    return l


def u(l, q):
    return l - q


def rho0(u, C):
    return u / C


def tp(l, N, tno):
    return l * tno / (N - l)


def w(tp, to):
    return tp - to


def tc(tp, tno):
    return tp + tno


def rhoe(Tc, tno):
    return tno / Tc


def n_(N, l):
    return N - l


def rhoe2rho0(rhoe, rho0):
    return rhoe / rho0


def y(L, S1, S, C):
    return C * S1 + L * S


FONT_STYLE = 'Times New Roman'
BIG_FONT = (FONT_STYLE, 18)
