    perems_name = ['C', u'P0', 'Q', 'L', 'U', u'ρ0', 'n', u'ρe', 'W', 'Tp', 'Tц', '(ρe)/ρ0', 'Y', 'round']
    data = [[p] + ['-'] * 3 for p in perems_name]
