                To = int(values['To'])
                Tno = int(values['Tno'])
                S1 = int(values['S1'])
                S = int(values['S'])
                Cs = [int(values[k]) for k in ['C1', 'C2', 'C3']]
                around = int(values['round'])
                psi = To / Tno
                Y = []
                Tp = []
                res_L = []
                perems = [perems_name]
                for C in Cs:
                    pk = p0(N=N, psi=psi, C=C)
                    Q = q(pk, C=C, N=N)
                    res_L.append(L(pk, N=N))
                    U = u(res_L[-1], Q)
                    Rho0 = rho0(U, C=C)
                    Tp.append(tp(res_L[-1], N=N, tno=Tno))
                    W = w(Tp[-1], to=To)
                    Tc = tc(Tp[-1], tno=Tno)
                    Rhoe = rhoe(Tc, tno=Tno)
                    n = n_(N=N, l=res_L[-1])
                    Re2R0 = rhoe2rho0(Rhoe, Rho0)
                    Y.append(y(L=res_L[-1], S1=S1, S=S, C=C))
                    perems.append(
                        [C, round(pk[0], around), round(Q, around), round(res_L[-1], around), round(U, around),
                         round(Rho0, around),
                         round(n, around), round(Rhoe, around), round(W, around), round(Tp[-1], around), round(Tc, around),
                         round(Re2R0, around), round(Y[-1], around)])

