                ax[0].grid(True)
                ax[0].set_xticks([_ for _ in range(0, max(Cs) + 1)])
                ax[0].set_title('График затрат')
                ax[0].set_xlabel('Кол-во ремонтников, человек', fontsize=15)
                ax[0].set_ylabel('Затраты, руб/час', fontsize=15)
                ax[0].patch.set_facecolor('#f0f0f0')
                ax[0].set_ylim([min(Y) // 10 * 10 - 50, max(Y) // 10 * 10 + 50])
                ax[0].set_xlim([min(Cs) - 1, max(Cs) + 1])
                ax[0].minorticks_on()
                ax[0].xaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[0].yaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[0].yaxis.grid(which='minor', linestyle='-', linewidth='0.5', color='black', alpha=0.15)

                ax[1].plot(Cs, res_L, color='b')
                ax[1].grid(True)
                ax[1].set_xticks([_ for _ in range(0, max(Cs) + 1)])
                ax[1].set_title('График компьютеров в неисправном состоянии')
                ax[1].set_xlabel('Кол-во ремонтников, человек', fontsize=15)
                ax[1].set_ylabel('Ср. количество компьютеров, находящихся в неисправном состоянии', fontsize=15)
                ax[1].patch.set_facecolor('#f0f0f0')
                ax[1].set_xlim([min(Cs) - 1, max(Cs) + 1])
                ax[1].minorticks_on()
                ax[1].xaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[1].yaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[1].yaxis.grid(which='minor', linestyle='-', linewidth='0.5', color='black', alpha=0.15)

                ax[2].plot(Cs, Tp, color='b')
                ax[2].grid(True)
                ax[2].set_xticks([_ for _ in range(0, max(Cs) + 1)])
                ax[2].set_title('График ср. времени компьютеров в неисправном состоянии')
                ax[2].set_xlabel('Кол-во ремонтников, человек', fontsize=15)
                ax[2].set_ylabel('Ср. время пребывания компьютера в неисправном состоянии, c', fontsize=15)
                ax[2].patch.set_facecolor('#f0f0f0')
                ax[2].set_xlim([min(Cs) - 1, max(Cs) + 1])
                ax[2].minorticks_on()
                ax[2].xaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
                ax[2].yaxis.grid(which='major', linestyle='-', linewidth='0.5', color='black', alpha=0.35)
